export const schema = `{
    "type": "object",
    "tablename": "People",
    "properties": {
      "name": {
        "type": "string"
      },
      "age": {
        "type": "integer",
      },
      "country": {
        "type": "string",
        "enum": ["Finland","Sweden","Norway"]
      },
      "married": {
        "type": "boolean",
        "default": false
      }
    },
    "required": [
      "name",
      "age",
      "married"
    ]
  }`;

export default schema
